    SHR_IF_ERR_EXIT(_dbal_init_tables_tcam_context_selection_tcam_cs_pmf_definition_tcam_cs_ipmf3_init(unit, cur_table_param, table_info));
    SHR_IF_ERR_EXIT(_dbal_init_tables_tcam_context_selection_tcam_cs_pmf_definition_tcam_cs_epmf_init(unit, cur_table_param, table_info));
